function Sidebar() {
  const blocks = [
    "Hero Section",
    "Bio Section",
    "Gallery",
    "Publications",
    "Contact Section",
    "Footer",
  ];

  const onDragStart = (e, type) => {
    e.dataTransfer.setData("blockType", type);
  };

  return (
    <aside className="sidebar">
      <h3 className="sidebar-title">Block Library</h3>

      <button className="export-project-btn">
        Export Project
      </button>

      <div className="block-list">
        {blocks.map((block) => (
          <div
            key={block}
            className="sidebar-block"
            draggable
            onDragStart={(e) => onDragStart(e, block)}
          >
            {block}
          </div>
        ))}
      </div>
    </aside>
  );
}

export default Sidebar;
